import { Row } from "antd";
import Search from "antd/lib/transfer/search";
import React from "react";

const main_search = () => {
  return (
    <>
      <Row>
        <Search placeholder="City, Zip, County" />
      </Row>
    </>
  );
};

export default main_search;
